import { createRouter, createWebHistory } from 'vue-router';
import Home from '../views/HomeView.vue'; // 홈 화면 컴포넌트
import Login from '../views/LoginView.vue'; // 로그인 화면 컴포넌트
import Signup from '../views/SignupView.vue'; // 회원가입 화면 컴포넌트
import CategoryView from '../views/CategoryView.vue'; // 카테고리 화면 컴포넌트
import CommunityView from '../views/CommunityView.vue'; // 커뮤니티 화면 컴포넌트
import GuidelinesView from '../views/GuidelinesView.vue'; // 이용안내 화면 컴포넌트
import MyBooksView from '../views/MyBooksView.vue'; // 나만의 책장 화면 컴포넌트

const routes = [
  { path: '/', name: 'Home', component: Home }, // 홈 경로
  { path: '/login', name: 'Login', component: Login }, // 로그인 경로
  { path: '/signup', name: 'Signup', component: Signup }, // 회원가입 경로
  { path: '/category', name: 'Category', component: CategoryView }, // 카테고리 경로
  { path: '/community', name: 'Community', component: CommunityView }, // 커뮤니티 경로
  { path: '/guidelines', name: 'Guidelines', component: GuidelinesView }, // 이용안내 경로
  { path: '/mybooks', name: 'MyBooks', component: MyBooksView }, // 나만의 책장 경로
];

const router = createRouter({
  history: createWebHistory(), // HTML5 History 모드 사용
  routes,
});

export default router;
